import React from "react";


class ElementLegend extends React.Component {
	constructor(props) {
		super(props);
	}
	
	render() {
        return (
            <div className="gridLegend">
                <div className="metalsTitle">
                    Metals
                </div>
                <div className="nonmetalsTitle">
                    Nonmetals
                </div>
                <div>
                </div>
            </div>
		);
	}
}

export default ElementLegend
